To determine the median of the numbers from 1 to 27, we first need to understand what a median is. The median is the middle number in a sorted list of numbers. If the list has an odd number of elements, the median is the element in the middle. If the list has an even number of elements, the median is the average of the two middle elements.

In this problem, we are given the numbers from 1 to 27. Since 27 is an odd number, the list of numbers from 1 to 27 has 27 elements. The median will be the 14th number in this sorted list.

To find the 14th number in the list from 1 to 27, we simply note that the list is simply the sequence of positive integers from 1 to 27. Therefore, the 14th number in this list is 14.

Thus, the median of the numbers from 1 to 27 is \(\boxed{14}\).```

